
CREATE TABLE file (
    id integer NOT NULL,
    title character varying(120),
    type character varying(80),
    pub_date date,
    owner_id integer,
    data bytea
);

CREATE SEQUENCE file_id_seq
    START WITH 2
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


CREATE TABLE "user" (
    id integer NOT NULL,
    username character varying(80),
    password character varying(80)
);

CREATE SEQUENCE user_id_seq
    START WITH 2
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;



